import './App.css';
import * as React from 'react';
import {Select,TextField, InputLabel,MenuItem,FormControl,Radio,RadioGroup,Button,FormControlLabel,FormLabel} from '@mui/material';
import { render } from '@testing-library/react';


class App extends React.Component{
  constructor(props){
    super(props);

    this.state ={
      user:{
        Firstname:"",
        Lastname:"",
        Gender:"",
        Country:"",
        State:"",
        PhoneNumber:"",
        EmailId:""

      }
    }
  }

  handleClick(event){
    console.log(this.state.user);
  }

  handleChange = (event) => {

  }


  render() {
    return (

      <div>

        <div className='body'>
              <img src={require('../src/img.jpeg')}/>
        </div>

        <div className='body'>
          <TextField sx={{ m: 1, minWidth: 400 }} placeholder='First name' />
        </div>

        <div className='body'>
          <TextField  sx={{ m: 1, minWidth: 400 }}  className='Textfield'  placeholder='Last name' />
        </div>

        <div className='body'>
          <FormControl  >
          <FormLabel className='body' >Gender</FormLabel>
            <RadioGroup row>
              <FormControlLabel value="female" control={<Radio />} label="Female" />
              <FormControlLabel value="male" control={<Radio />} label="Male" />
              <FormControlLabel value="other" control={<Radio />} label="Other" />
            </RadioGroup>
          </FormControl>
        </div>

        <div className='body'>
          <FormControl sx={{ m: 1, minWidth: 400 }} >
            <InputLabel >Country</InputLabel>
              <Select>
                <MenuItem  value={'India'}>India</MenuItem>
                <MenuItem value={'Afganistan'} >Afganistan</MenuItem>
                <MenuItem value={'Australia'}>Australia</MenuItem>
                <MenuItem value={'Bangladesh'}>Bangladesh</MenuItem>
                <MenuItem value={'Brazil'}>Brazil</MenuItem>
                <MenuItem value={'China'}>China</MenuItem>
                <MenuItem value={'France'}>France</MenuItem>
                <MenuItem value={'Italy'}>Italy</MenuItem>
              </Select>
          </FormControl>
        </div>

        <div className='body'>
          <TextField  sx={{ m: 1, minWidth: 400 }} className='Textfield'  placeholder='State' />
        </div>

        <div className='body'>
          <TextField sx={{ m: 1, minWidth: 400 }}  className='Textfield'  placeholder='Phone Number' />
        </div>

        <div className='body'>
          <TextField sx={{ m: 1, minWidth: 400 }} className='Textfield'  placeholder='Email Address' />
        </div>


        <div className='body'>
          <Button sx={{ m: 1, minWidth: 400 }}  variant="contained">Submit </Button>
        </div>



    </div>

    );
  }
}

export default App;
